function Card(props){
      return (<>
    
    
      <div className="container">
         <img src={props.imgsrc}/>
        
        <div className= 'details'>
             <h3 className='title'>{props.title}</h3>
               <p className= 'sname' > {props.sname }</p>
              <span>
           <a href={props.link}  target = "_blank"> <button>  watch now</button></a> </span>
         </div>
      </div>
    
    </>
    
      )
    }

export default Card ;
